import AppBar from '../components/AppBar2'
import Drawer from '../components/Drawer2';
import * as React from 'react';
import Box from '@mui/material/Box';
import { styled, createTheme, ThemeProvider } from '@mui/material/styles';
import CssBaseline from '@mui/material/CssBaseline';
import Grid from '@mui/material/Grid';
import Paper from '@mui/material/Paper';
import Toolbar from '@mui/material/Toolbar';
import Title from '../components/Title';
import Slider from '@mui/material/Slider';
import Typography from '@mui/material/Typography';
import axios from 'axios'
import Container from '@mui/material/Container';


//Das ist mein Base Template auf dem alle Pages auÃŸer eventuell der Landing page aufbauen werden


const Details = () => {

    const [open, setOpen] = React.useState(false);
    const [page, setPage] = React.useState("Details");
    const [params, setParams] = React.useState(null);
    const defaultTheme = createTheme();

    const GetParams = async () => {
        try {
            const response = await axios.get('http://localhost:8000/getParamData', {})
            console.log("here")
            setParams(response.data)
            console.log(response.data)
            
        } catch (error) {
            console.log(error)
        }
    }

    React.useEffect(() => {
        GetParams()
        
     },[]) 

    return (
        
         <ThemeProvider theme={defaultTheme}>
            <Box sx={{ display: 'flex' }}>
                <CssBaseline />
                <AppBar open ={open} setOpen = {setOpen} page = {page}/>
                <Drawer open ={open} setOpen = {setOpen} page = {page}/>
                <Box
                component="main"
                sx={{
                    backgroundColor: (theme) =>
                    theme.palette.mode === 'light'
                        ? theme.palette.grey[100]
                        : theme.palette.grey[900],
                    flexGrow: 1,
                    height: '100vh',
                    overflow: 'auto',
                }}
                >
                    <Toolbar />
                    {params?.map((param, _index) => (
                        <Container maxWidth="lg" sx={{ mt: 4, mb: 4 }}>
                            <Typography component="h4" variant="h4" color="primary" gutterBottom>
                                Daten zu {param?.Kameraname}
                            </Typography>
                            <Grid container spacing={3}>
                            <Grid item xs={12} md={12} lg={12}>
                                <Paper
                                        
                                    sx={{
                                        p: 2,
                                        display: 'flex',
                                        flexDirection: 'column',
                                        height: 'auto',
                                        alignItems: 'center',
                                        textAlign: "center",
                                        verticalAlign: "middle",
                                        justifyContent: "center",
                                    }}
                                    onClick = {HandleClick}
                                    >
                                        <Title>Anzahl Wafer nach Stunden</Title>
                                        <BarChart barchartdata = {barchartdata} barchartbeschriftung ={barchartbeschriftung}/>
                                </Paper>
                            </Grid>
                            <Grid item xs={8} md={8} lg={8}>
                                <Paper
                                        
                                    sx={{
                                        p: 2,
                                        display: 'flex',
                                        flexDirection: 'column',
                                        height: 'auto',
                                        alignItems: 'center',
                                        textAlign: "center",
                                        verticalAlign: "middle",
                                        justifyContent: "center",
                                    }}
                                    >
                                        <Title>Ergebnisse der Farbanalyse in der letzten Stunde</Title>
                                        {BasicPie(piechartbeschriftung, piechartdata)}

                                </Paper>
                            </Grid>
                            <Grid item xs={4} md={4} lg={4}>
                                <Paper
                                        
                                    sx={{
                                        p: 2,
                                        display: 'flex',
                                        flexDirection: 'column',
                                        height: 'auto',
                                        alignItems: 'center',
                                        textAlign: "center",
                                        verticalAlign: "middle",
                                        justifyContent: "center",
                                    }}
                                    >
                                        <Title>Wafer Durchsatz in den letzten 30 Sekunden</Title>
                                        {CircularProgressWithLabel(value)}

                                </Paper>
                            </Grid>
                        
                            </Grid>
                            </Container>
                            ))}

                </Box>
            </Box>
        </ThemeProvider>
    );
}
    
export default Details;
